import React, { Component } from "react";
import { Link } from "react-router-dom";
import {
  Badge,
  BreadcrumbItem,
  Breadcrumb,
  Container,
  Sidebar
} from "reactstrap";
class Header extends Component {
  render() {
    return (
      <div class="ui grid">
        <div class="four wide column">
          <div class="ui vertical fluid tabular menu">
            <Link to="/" class="active item">
              Home
            </Link>
            <Link to="/items" class="item">
              Items
            </Link>
            <Link to="/units" class="item">
              Units
            </Link>
            <Link to="transactions" class="item">
              Transactions
            </Link>
            <Link to="stocks" class="item">
              Stocks
            </Link>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
